def process_raw_data() -> dict[str, str]:
    processed = {}
    for line in certs_data.splitlines():
        tokens = list(map(lambda x: x.strip(), line.split(':')))
        if len(tokens) == 2:
            processed[tokens[0]] = tokens[1]
    print(f"Process raw data returning {len(processed)} certs")
    return processed

def clear_and_tokenize_file_names():
    data = certs_data
    result = []
    for name in data:
        tokens = name.split(" ")
        tokens = list(map(lambda x: x.strip(")").strip("(").strip("[").strip("]").strip(".csv").lower(), tokens))
        tokens = filter(lambda x: len(x) > 2 and not x.isnumeric() and not ("provided" in x or "xx" in x or "undisclosed" in x) and not all(c.isdigit() or c.lower() in 'abcdef' or c.isspace() for c in x), tokens)
        result += [list(tokens)]
    
    return result